import './App.css';
import NavBar from './components/NavBar';
import Home from './components/Home';
import Footer from './Footer';
import PlayStoreStats from './'

function App() {
  return (
    <div className="App container-fluid" id='app'>
      <NavBar/>
      <div id='top-panel'>
        <Home/>
        <PlayStoreStats/>
      </div>

    </div>
  );
}

export default App;
